import classes from "./Header.module.scss";

const Header = () => {
    return(
        <header className={classes.header}>
            <div className={classes.header__content}></div>
            <h2 className={classes.headerTitle}>Amikom Presensi</h2>
        </header>
    )
}

export default Header
